    $2,500 (our initial contribution) due to the fact we made a contribution to their
    campaign for $2,500 in December 2010 for an election that actually took place
    in August 2010.  Form 99 was filed with the FEC by KCS Employees PAC on June 8,
    2011, confirmation number FEC-730810.  Copy of reimbursement check from Long Campaign
    is being faxed to Kevin Fortkiewicz with the FEC.\n"
